package com.EsportLeagueStats.ESLS.web.requests;public class AddUtakmicaRequest {    public  String pobednik;    public String vremeTraenje;    public int seid;    public AddUtakmicaRequest(String pobednik, String vremeTraenje, int seid) {        this.pobednik = pobednik;        this.vremeTraenje = vremeTraenje;        this.seid = seid;    }    public String getPobednik() {        return pobednik;    }    public String getVremeTraenje() {        return vremeTraenje;    }    public int getSeid() {        return seid;    }}